import { MDBContainer, MDBRow, MDBCol, MDBCard, MDBCardBody, MDBInput, MDBBtn, MDBIcon } from 'mdbreact';
import { Link } from 'react-router-dom';
import React, { Component } from 'react';

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {value: ''};
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleSubmit(){
    console.log(this.state.value);
  }
  handleChange(event) {
    this.setState({value: event.target.value});
  }
  render(){
    return (
      <MDBRow>
        <MDBRow>
          <MDBCol md="6">
            <MDBCard>
              <div className="header pt-3 peach-gradient">
                <MDBRow className="d-flex justify-content-center">
                  <h3 className="blue-text mb-3 pt-3 font-weight-bold">
                    Log in
                  </h3>
                </MDBRow>
              </div>
              <MDBCardBody className="mx-4 mt-4">
                <MDBInput label="Your email" group type="text" validate="true" />
                <MDBInput
                  onChange={this.handleChange}
                  value={this.state.value}
                  label="Your password"
                  group
                  type="password"
                  validate = "true"
                  containerClass="mb-0"
                />
                <p className="font-small grey-text d-flex justify-content-end">
                  Forgot
                  <a
                    href="#!"
                    className="dark-grey-text ml-1 font-weight-bold"
                  >
                    Password?
                  </a>
                </p>
                <MDBRow className="d-flex align-items-center mb-4 mt-5">
                  <MDBCol md="5" className="d-flex align-items-start"></MDBCol>
                    <div className="text-center">

                      <button className="waves-effect waves-light btn bg-black"
                        onClick={()=>{this.handleSubmit()}}
                        >
                        Log in
                      </button>

                    </div>
                </MDBRow>
              </MDBCardBody>
            </MDBCard>
          </MDBCol>
        </MDBRow>
      </MDBRow>
    );
  };
  }


export default Login;
